import React, { Component } from 'react'
import '../Css/Nav.css';

export default class Nav extends Component {
  render() {
    return (
      <div className="App-Nav">
        <ul>
          <li><Link></Link>How To</li>
          <li>Features</li>
          <li>Process</li>
          <li>Profile</li>
        </ul>
      </div>
    )
  }
}
